  <meta charset="utf-8" />

  <title>PublicLogic</title>
  <meta name="description" content="PublicLogic â€” We build systems that keep trust intact." />

  <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;700&display=swap" rel="stylesheet">
  <style>
    :root {
      --sage:#3f6a52;
      --ink:#0f1720;
      --muted:#667085;
      --ring:0 0 0 4px rgba(63,106,82,.18);
    }
    html,body {
      height:100%;
      margin:0;
      background:#fff;
      color:var(--ink);
      font-family:'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Helvetica, Arial, sans-serif;
      -webkit-font-smoothing:antialiased;
    }
    body {
      display:flex; flex-direction:column; min-height:100vh;
    }
    main {
      flex:1 0 auto;
      display:flex; align-items:center; justify-content:center;
      padding:24px;
    }
    .stack {
      display:flex; flex-direction:column; align-items:center; text-align:center;
      gap:14px;
    }
    .logo {
      width:clamp(240px, 26vw, 540px);
      height:auto; display:block; margin:0 auto;
    }
    .mission {
      font-size:18px; color:var(--ink); font-weight:500;
      margin:6px 0 4px 0;
    }
    .status {
      color:var(--muted); font-size:15px; margin:2px 0 8px 0;
    }
    .btn {
      display:inline-block; background:#fff; color:var(--sage);
      border:2px solid var(--sage); border-radius:12px;
      padding:10px 26px; font-weight:600; font-size:14px;
      text-decoration:none; transition:all .2s ease-in-out;
    }
    .btn:hover {
      background:var(--sage); color:#fff; border-color:var(--sage);
    }
    .btn:focus-visible {
      outline:none; box-shadow:var(--ring);
    }
    footer {
      flex-shrink:0;
      text-align:center;
      color:#98a2b3;
      font-size:13px;
      padding:12px 0 16px;
    }
  </style>
</head>
